import React from "react";



const Movies = ()=> {
    return (
        <div>
            <div className="box">
                <img src="image.jpg" />
                <div className="text">
                    <h3 className="name">Rapture</h3>
                    
                </div>
            </div>
        </div>
    )
}

export default Movies
